                <div className="col-7">
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                    <EditMyPlaylistItem></EditMyPlaylistItem>
                </div>
            </div>
        );
    }
}

export default EditMyPlaylist;
